var current_airline_icao = msg.payload.callsign ?msg.payload.callsign.substr(0,3):"N/A";
var origin_airport_iata = msg.payload.origin ? msg.payload.origin :"unbekannt";
var destination_airport_iata = msg.payload.destination ? msg.payload.destination :"unbekannt";
var registration = msg.payload.registration ? msg.payload.registration :"N/A";
var squawkCode = msg.payload.squawkCode ? msg.payload.squawkCode : "N/A";
var airlines = flow.get("airlines");
var airports = flow.get("airports");
var photo_url_base = "https://www.jetphotos.com/registration/"
var cache = global.get("flugzeuge")
msg.payload.human={}
msg.payload.popup = "<h3>Moment....</h3"

msg.payload.name = registration

// eigentlich überflüssig seid jetphotos
airlines.forEach(function(al) {
    if(al.abr==current_airline_icao) {
        msg.payload.human["airline"] = al.line
        msg.payload.human["land"] = al.country
        if(al.country=="Germany") {
            msg.payload.iconColor = "#8dff33"
        }      
    }
});

/*
if (registration.substr(1, 2) == "-H" &&
    registration.substr(0, 3) != "F-H" &&
    registration.substr(0, 3) != "G-H")
*/
if (["D-H"].includes(registration.substr(0, 3))||
    ["OE-X","HB-X","TC-H"].includes(registration.substr(0, 4)))
{
    msg.payload.icon = "helicopter"
    msg.payload.iconColor = "#0000FF"
}

if (["7000"].includes(squawkCode) ||
["D-B", "D-C","D-E","D-M","D-I","D-G", "D-F", "D-K","D-L","D-N","D-O"].includes(registration.substr(0, 3)) ||
["2-JE","4K-A","9H-O","9H-V","CS-C","CS-D","CS-G","CS-L","CS-P","D-AC","EC-K","ES-A","HB-J","I-AD","LN-A","LZ-B",
"M-CH","M-OV","M-SE",
"OE-F","OK-U","OP-D","OY-C","OK-P","OY-N","PH-D","PH-E","PH-N","PH-V","PH-Z","PP-L","PS-A","RA-6",
"S5-C","SU-M","T7-D","YU-B","YU-P","YU-R","YU-S","YU-T",
"ZS-C","ZS-Y"
].includes(registration.substr(0, 4))) {
    msg.payload.iconColor = "#66FFFF"
    if (msg.payload.icon != "helicopter")
        msg.payload.icon = "smallplane"
}

if (["0020", "0023", "0024", "0025", "0027", "0030", "0033", "0034", "0036", "0037"].includes(squawkCode)) {
    msg.payload.iconColor = "#FF0066"
}

if (["7500", "7600", "7700"].includes(squawkCode)) {
    msg.payload.iconColor = "#FF0000"
    node.log("NOTFALL !!!");
}
msg.payload.human["gestarted in"] = "N/A"
msg.payload.human["Ziel"] = "N/A"

airports.forEach(function(ap) {
  if(ap.abr==origin_airport_iata) {
      msg.payload.human["gestarted in"] = ap.name+" "+ap.country
  }
  if(ap.abr==destination_airport_iata) {
      msg.payload.human["Ziel"] = ap.name+" "+ap.country
  }
});

cache.push(msg.payload)
global.set("flugzeuge", cache)

// und ab in den globalen context
return msg;
